import Tabs from '@theme/Tabs';
import TabItem from '@theme/TabItem';
import useBaseUrl from '@docusaurus/useBaseUrl';
import RedisCard from '@site/src/theme/RedisCard';
export const toc = [{
  value: 'Introduction',
  id: 'introduction',
  children: [{
    value: 'Redis Launchpad',
    id: 'redis-launchpad',
    children: []
  }, {
    value: 'More Developer Resources',
    id: 'more-developer-resources',
    children: []
  }, {
    value: 'Redis University',
    id: 'redis-university',
    children: []
  }, {
    value: 'Redis for JavaScript Developers',
    id: 'redis-for-javascript-developers',
    children: []
  }]
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Find tutorials, examples and technical articles that will help you to develop with Redis and Node.js/JavaScript.`}</p>
    <h2 {...{
      "id": "introduction"
    }}>{`Introduction`}</h2>
    <p>{`Redis is a great database for use with Node.js. Both Redis Node.js share similar type conventions and threading models, which makes for a very predictable development experience. By pairing Node.js & Redis together you can achieve a scalable and productive development platform.`}</p>
    <p>{`Redis Node.js has two primary clients available `}<a parentName="p" {...{
        "href": "https://github.com/NodeRedis/node_redis"
      }}>{`node_redis`}</a>{` and `}<a parentName="p" {...{
        "href": "https://github.com/luin/ioredis"
      }}>{`ioredis`}</a>{`. Both are available through npm. Both clients have pros and cons, but we generally suggest node_redis, as it has wide support for Redis modules, it is easily extensible and widely used. Ioredis has better integrated support for the Redis Enterprise Cluster API, but this is only relevant if you're specifically using `}<a parentName="p" {...{
        "href": "https://redis.com/redis-enterprise/technology/linear-scaling-redis-enterprise/"
      }}>{`the Cluster API topology`}</a>{` instead of the more common Proxy topology. Node_redis’ support for the Cluster API is provided by an additional shim, redis-clustr. Node_redis has built-in support for Redis Enterprise features such as `}<a parentName="p" {...{
        "href": "https://redis.com/redis-enterprise/technology/active-active-geo-distribution/"
      }}>{`Active Active geo distribution`}</a>{`, allowing you to have one database that spans multiple clusters. Node_redis also supports Redis-on-Flash which enables extending your database into Flash SSD storage for warm values and DRAM for hot values. Nodejs redis enables you to integrate such features.`}</p>
    <p>{`The Node.js community has built many client libraries that you can find `}<a parentName="p" {...{
        "href": "https://redis.io/clients#nodejs"
      }}>{`here`}</a>{`.
For your first steps with Node.js and Redis, this article will show how to use the recommended libraries: `}<a parentName="p" {...{
        "href": "https://github.com/luin/ioredis"
      }}>{`ioredis`}</a>{` and `}<a parentName="p" {...{
        "href": "https://github.com/NodeRedis/node-redis"
      }}>{`node-redis`}</a>{`.`}</p>
    <Tabs defaultValue="ioredis" values={[{
      label: 'IO redis',
      value: 'ioredis'
    }, {
      label: 'Node Redis',
      value: 'node_redis'
    }]} mdxType="Tabs">
    <TabItem value="ioredis" mdxType="TabItem"> 
        <h4 {...{
          "id": "step-1-install-the-ioredis-library-using-npm-or-yarn"
        }}>{`Step 1. Install the ioredis library using `}<inlineCode parentName="h4">{`npm`}</inlineCode>{` (or `}<inlineCode parentName="h4">{`yarn`}</inlineCode>{`)`}</h4>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` npm install ioredis
`}</code></pre>
        <h4 {...{
          "id": "step-2-write-your-application-code"
        }}>{`Step 2. Write your application code`}</h4>
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{` const Redis = require("ioredis");
 const redis = new Redis(6379, "localhost");

 redis.set("mykey", "Hello from io-redis!");
 redis.get("mykey", function(err, result){
     if (err) { throw err; }

     console.log(result);
 });

 // use the promise instead of callback
 redis.get("mykey").then(function (result) {
     console.log(result);
 });

 redis.zadd("vehicles", 0, "car", 0, "bike");
 redis.zrange("vehicles", 0, -1, "WITHSCORES").then((res) => console.log(res));

`}</code></pre>
        <p>{`Find more information about Redis & io-redis connections in the "`}<a parentName="p" {...{
            "href": "https://github.com/redis-developer/redis-connect/tree/master/node.js/ioredis"
          }}>{`Redis Connect`}</a>{`" repository.`}</p>
  </TabItem>
  <TabItem value="node_redis" mdxType="TabItem">
        <h4 {...{
          "id": "step-1-install-the-redis-library-using-npm-or-yarn"
        }}>{`Step 1. Install the Redis library using `}<inlineCode parentName="h4">{`npm`}</inlineCode>{` (or `}<inlineCode parentName="h4">{`yarn`}</inlineCode>{`)`}</h4>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`  npm install redis
`}</code></pre>
        <h4 {...{
          "id": "step-2-write-your-application-code-1"
        }}>{`Step 2. Write your application code`}</h4>
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`  const redis = require("redis");

  const client = redis.createClient ({
      port : 6379,
      host : "localhost"
  });

  client.set("mykey", "Hello from node-redis!");
  client.get("mykey", function(err, result){
      if (err) { throw err; }

      console.log(result);
  });

  const vehiclesData = ["vehicles", 4, "car", 2, "bike"];
  client.zadd(vehiclesData, function(addError, addResponse) {
      if (addError) { throw addError; }

      console.log("added " + addResponse + " items.");

      const query = ["vehicles", 0, -1];
      client.zrange(query, function(rangeError, rangeResponse) {
          if (rangeError) {throw rangeError;}
          console.log("vehicles", rangeResponse);
      });
  });

`}</code></pre>
        <p>{`Find more information about Redis & node-redis connections in the "`}<a parentName="p" {...{
            "href": "https://github.com/redis-developer/redis-connect/tree/master/node.js/node-redis"
          }}>{`Redis Connect`}</a>{`" repository.`}</p>
  </TabItem>
    </Tabs>
    <hr></hr>
    <h3 {...{
      "id": "redis-launchpad"
    }}>{`Redis Launchpad`}</h3>
    <p>{`Redis Launchpad is like an “App Store” for Redis sample apps. You can easily find apps for your preferred frameworks and languages.
Below are few of these apps. `}<a parentName="p" {...{
        "href": "https://launchpad.redis.com"
      }}>{`Click here to access the complete lists of apps`}</a>{`.`}</p>
    <div class="row text--center">
      <div class="col ">
        <div className="ri-container">
          <h4 {...{
            "id": "hacker-news-clone-in-nodejs"
          }}>{`Hacker News Clone in NodeJS`}</h4>
          <p><img alt={"marketplace"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/hackernews.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Aredis-hacker-news-demo"
            }}>{`A Hacker News Clone project`}</a>{` built in NextJS, NodeJS and Express based on RediSearch & RedisJSON`}</p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "shopping-cart-application-in-nodejs"
          }}>{`Shopping Cart application in NodeJS`}</h4>
          <p><img alt={"marketplace"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/shoppingcartnodejs.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-redis-shopping-chart-nodejs"
            }}>{`Shopping Cart app in NodeJS`}</a>{` module functionalities`}</p>
        </div>
      </div>
    </div>
    <hr></hr>
    <h3 {...{
      "id": "more-developer-resources"
    }}>{`More Developer Resources`}</h3>
    <div class="row">
      <div class="col">
        <h4 {...{
          "id": "sample-code"
        }}>{`Sample Code`}</h4>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://developer.redis.com/howtos/caching/"
            }}>{`Basic Redis Caching`}</a></strong>{`
This application calls the GitHub API and caches the results into Redis.`}</p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://developer.redis.com/howtos/ratelimiting/"
            }}>{`Redis Rate-Limiting`}</a></strong>{`
This is a very simple app that demonstrates rate-limiting feature using Redis.`}</p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://github.com/redis-developer/redis-websockets-vue-notifications"
            }}>{`Notifications with WebSocket, Vue & Redis`}</a></strong>{`
This project allows you to push notifications in a Vue application from a Redis `}<inlineCode parentName="p">{`PUBLISH`}</inlineCode>{` using WebSockets.`}</p>
      </div>
      <div class="col">
        <h4 {...{
          "id": "technical-articles--videos"
        }}>{`Technical Articles & Videos`}</h4>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://www.youtube.com/watch?v=H6rikGCYPUk"
            }}>{`Redis Rapid Tips: ioredis`}</a></strong>{` (YouTube)`}</p>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://www.youtube.com/watch?v=dukkMLbzPfA"
            }}>{`Mapping Objects between Node and Redis`}</a></strong>{` (YouTube)`}</p>
      </div>
    </div>
    <hr></hr>
    <h3 {...{
      "id": "redis-university"
    }}>{`Redis University`}</h3>
    <h3 {...{
      "id": "redis-for-javascript-developers"
    }}><a parentName="h3" {...{
        "href": "https://university.redis.com/courses/ru102js/"
      }}>{`Redis for JavaScript Developers`}</a></h3>
    <p>{`Build full-fledged Redis applications with Node.js and Express.`}</p>
    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/Ik1WXPX3WNU" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
